import React from 'react';
import { Layout } from 'antd';
import './home-page.style.css';

const {
  Header, Footer, Sider, Content,
} = Layout;
const HomePage = () => (
  <Layout>
    <Header>Header</Header>
    <Layout>
      <Sider>Sider</Sider>
      <Content>Content</Content>
    </Layout>
    <Footer>Footer</Footer>
  </Layout>
);
export default HomePage;
